import React from "react";

export default class MovieDetails extends React.Component {
  constructor(props) {
    super(props);
  }

  displayDetails = () => {
    const movie = this.props.location.movie;
    return (
      <div>
        <h3>{movie.Title}</h3>
      </div>
    );
  };

  render() {
    return <div>{this.displayDetails()}</div>;
  }
}
